import axios from "axios";

export class ApiContext {
    constructor(pathUrl = '') {
        this.baseURL = 'https://ekyckhoaluan.herokuapp.com/' + pathUrl;
        this.instance = axios.create(
            {
                baseURL: this.baseURL,
                headers: {
                    'Content-Type': 'application/json',
                }
            }
        );

        this.instance.interceptors.request.use(function (config) {
            return config;
        }, function (error) {
            return error;
        });

        this.instance.interceptors.response.use(function (response) {
            return response.data;
        }, function (error) {
            return { error };
        });
    }

    get(config = {}) {
        return this.instance.get(this.baseURL, config);
    }

    post(data = {}, config = {}) {
        return this.instance.post(this.baseURL, data, config);
    }

    put(data = {}, config = {}) {
        return this.instance.put(this.baseURL, data, config);
    }

    delete(config = {}) {
        return this.instance.delete(this.baseURL, config);
    }

}

